      '<div class="grocery-product__container"><div class="product-blocks"><div class="product-info-block product-info-block--product-marketing " id="product-marketing"><ul class="product-info-block__content"><li class="product-info-block__content-item">Ensure long-lasting, mould-free protection &amp; strong seals - with the UniBond Anti-Mould Sealant!</li><li class="product-info-block__content-item">Protect your bathroom and kitchen from mould with the powerful UniBond Anti Mould Sealant!</li><li class="product-info-block__content-item">As a high-quality and long-lasting joint filler, the waterproof and flexible silicone sealant is specially formulated to function in humid environments such as kitchens and bathrooms and is recommended for use as a kitchen sink sealant, worktop sealant or as a toilet sealant. Formulated with silicone acetoxy technology, the joint sealant provides long-lasting sanitary seals with high adhesion. The cartridge design ensures precise application. Waste no time with sealing jobs - this long-lasting sanitary silicone is touch dry within just 20 minutes and fully dry in 24 hours!</li><li class="product-info-block__content-item">The sanitary sealant is simple and effective. To apply, first ensure that any existing sealant is removed, and surfaces are clean and dry. Simply cut the tip off the cartridge above the screw thread. Then, remove the nozzle cap and trim the nozzle at an angle of 45\u00b0 to the desired joint width. Lastly, screw the nozzle onto the cartridge and insert the cartridge into the gun. Apply by pulling the trigger. To maintain a mould free finish, it is recommended to regularly clean the sealant of any soap or residue.</li><li class="product-info-block__content-item">The Product Benefits at a Glance:</li><li class="product-info-block__content-item">- Forms a permanently flexible, waterproof &amp; mould resistant sealant to prevent mould growth</li><li class="product-info-block__content-item">- Specially formulated for use in warm, humid environments (e.g. bathrooms &amp; kitchens)</li><li class="product-info-block__content-item">- Long-lasting sanitary sealant with high adhesion</li><li class="product-info-block__content-item">- Touch dry in 20 mins, fully dry in 24 hours</li><li class="product-info-block__content-item">- Colour: Translucent</li></ul></div><div class="product-info-block product-info-block--undefined "><h2 class="product-info-block__title product-info-block__title--h2 undefined">Information</h2></div><div class="product-info-block product-info-block--preparation-and-usage " id="preparation-and-usage"><h3 class="product-info-block__title product-info-block__title--h3 undefined">Preparation and Usage</h3><ul class="product-info-block__content"><li class="product-info-block__content-item">Drying Time</li><li class="product-info-block__content-item">Touch dry in 20 mins</li><li class="product-info-block__content-item">Fully dry in 24 hours</li></ul></div><div class="product-info-block product-info-block--net-contents " id="net-contents"><h3 class="product-info-block__title product-info-block__title--h3 undefined">Net Contents</h3><p class="product-info-block__content">274g</p></div></div></div>',
