    description:
      '<div class="grocery-product__container"><div class="product-blocks"><div class="product-info-block product-info-block--product-description " id="product-description"><h2 class="product-info-block__title product-info-block__title--h2 undefined">Product Description</h2><ul class="product-info-block__content"><li class="product-info-block__content-item">Like new in just 5 minutes</li><li class="product-info-block__content-item">Apply on top of existing sealant</li><li class="product-info-block__content-item">Triple protect mould resistance</li></ul></div><div class="product-info-block product-info-block--product-marketing " id="product-marketing"><ul class="product-info-block__content"><li class="product-info-block__content-item">UniBond RE-NEW - refresh old sealant in one easy step!</li><li class="product-info-block__content-item">Does your sink sealant in the bathroom or your kitchen silicone need refreshing? Unibond RE-NEW can help you quickly rejuvenate dirty, cracked or mouldy sealant faster than before! Simply apply the sanitary silicone on top of existing sealant without\u00a0the hassle of scraping out old sanitary sealant - it\u00b4s that simple! An integrated smoothing tool ensures an even finish - there is no need for a cartridge gun or a finishing tool! Thanks to the triple protection mould resistance the joint sealant repels, kills and prevents mould over the long term.\u00a0One tube of this mould resistant sealant typically covers one standard bathroom suite (1 bath, 1 shower and 1 sink).</li><li class="product-info-block__content-item">Thoroughly clean the sealant with household cleaner. Mouldy sealant must be treated with mould remover. Before applying, ensure the sealant is dry and free from oils, grease and dust. To minimise risk of air bubbles, shake the bottle downwards before each squeeze. Gently squeeze to apply on top of old sealant\u00a0holding the tube with the UniBond logo facing towards you. Repeat the process without squeezing for a professional finish. Remove excess sealant immediately with a damp cloth. Clean the tool with water and replace the cap. Allow at least 6 hours to dry before using the\u00a0shower. Not recommended for glazing sealants, joints with water pressure/permanent water immersion, applications in contact with foodstuffs, bituminous substrates, PE/PP/PTFE, acrylic, FRP, vinyl, mirrors, natural stone and building materials, plasticizers or solvents.</li><li class="product-info-block__content-item">The Product Benefits at a Glance:</li><li class="product-info-block__content-item">- Apply on top of the existing sealant</li><li class="product-info-block__content-item">- Integrated smoothing tool</li><li class="product-info-block__content-item">- Repels, kills &amp; prevents mould</li><li class="product-info-block__content-item">- Flexible &amp; waterproof sealant</li><li class="product-info-block__content-item">- Temperature resistant (-50\u00b0C to +120\u00b0C)</li><li class="product-info-block__content-item">- Technology: Silicotec</li><li class="product-info-block__content-item">- Colour: White</li><li class="product-info-block__content-item">- Format: 1 x 100ml Tube</li></ul></div><div class="product-info-block product-info-block--undefined "><h2 class="product-info-block__title product-info-block__title--h2 undefined">Information</h2></div><div class="product-info-block product-info-block--net-contents " id="net-contents"><h3 class="product-info-block__title product-info-block__title--h3 undefined">Net Contents</h3><p class="product-info-block__content">130g</p></div></div></div>',
