      '<div class="grocery-product__container"><div class="product-blocks"><div class="product-info-block product-info-block--product-marketing " id="product-marketing"><ul class="product-info-block__content"><li class="product-info-block__content-item">Damage-free hanging, holds strongly and removes cleanly. Easy to apply, no need for nails, screws or drills</li><li class="product-info-block__content-item">Command\u2122 Decorative Hooks come in a variety of styles from sophisticated to fun and playful - giving you options for every room and every person in your home. Using the revolutionary Command\u2122 Adhesive, Command\u2122 Decorative Hooks hold strongly on a variety of surfaces, including paint, wood, tile and more. Yet, they also come off cleanly - no holes, marks, sticky residue or stains - so you can take down and move your Command\u2122 hooks as often as you like. Reusing them is as easy as applying a Command\u2122 Refill Strip, so you can take down, move and reuse them again and again!</li></ul></div><div class="product-info-block product-info-block--other-information " id="other-information"><ul class="product-info-block__content"><li class="product-info-block__content-item">H17.15cm x W10.95cm x D5.4cm</li></ul></div><div class="product-info-block product-info-block--features " id="features"><ul class="product-info-block__content"><li class="product-info-block__content-item">Perfect for your front entry, laundry room, closet, kitchen and even the office</li><li class="product-info-block__content-item">Weight capacity: 1.8kg</li></ul></div><div class="product-info-block product-info-block--undefined "><h2 class="product-info-block__title product-info-block__title--h2 undefined">Information</h2></div><div class="product-info-block product-info-block--preparation-and-usage " id="preparation-and-usage"><h3 class="product-info-block__title product-info-block__title--h3 undefined">Preparation and Usage</h3><ul class="product-info-block__content"><li class="product-info-block__content-item">After attaching to wall wait 1 hour before hanging anything on the hook/strip. Ideal for solid, hollow and painted walls. Even painted woodchip wallpapers with fine or medium textures. Not suitable for unpainted paper or vinyl wallpaper.</li></ul></div></div></div>',
